import React, { useState } from 'react';

import { Conteudo } from './style';
import { Table } from 'antd';


export default function TabelaHistorico(){
    const data = [
        {
            nome: 'Rogerio',
            ra: '18123466',
            orientador: 'milton',
            i: 1,
            ar: 1,
            a: 3
        }
    ]

    const columns = [
        {
          title: 'Nome',
          dataIndex: 'nome',
          key: 'nome',
        },
        {
          title: 'RA',
          dataIndex: 'ra',
          key: 'ra',
        },
        {
          title: 'Orientador',
          dataIndex: 'orientador',
          key: 'orientador',
        },
        {
          title: 'Pareceres Orientador',
          dataIndex: 'parecerOrientador',
          key: 'parecerOrientador',
          children: [
            {
              title: 'Nº I',
              dataIndex: 'i',
              key: 'i'
            },
            {
              title: 'Nº AR',
              dataIndex: 'ar',
              key: 'ar'
            },
            {
              title: 'Nº A',
              dataIndex: 'a',
              key: 'a'
            }
          ]
        },
      ];

    return(
        <Conteudo>
            <Table
            columns={columns}
            dataSource={data}
            bordered
            size="middle"
            />
        </Conteudo>
    );
}
